import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { createOwner } from "../../../../services/api";
import Navbar from "../../../Navbar";
import Footer from "../../../Footer";
//import "./owner.css";

export default function Create() {
    const navigate = useNavigate();
    const [error, setError] = useState(false)
    const [loading, setLoading] = useState(false)
    const [owner, setOwner] = useState({
        firstName: "",
        lastName: "",
        address: "",
        city: "",
        telephone: ""
    });

    const handleChange = (e) => {
        // const name = e.target.name
        // const value = e.target.value
        const { name, value } = e.target;
        setOwner({...owner, [name]: value });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        console.log(owner); return;

        if (!owner.firstName.trim() || !owner.lastName.trim() || !owner.address.trim() || 
            !owner.city.trim() || !owner.telephone.trim()) {
            setError("All fields are required");
            return;
        }
        
        try {
            setLoading(true);
            const response = createOwner(owner)
            if (response.status === 200) {
                console.log("Owner created successfully.")
                navigate("/");
            }
        } catch (err) {
            console.error("Error creating owner:", err);
        } finally {
            setLoading(false);
        }
    };
    

    return (
        <>
            <Navbar />
            <div className="general">
                <div className="container">
                    <h1>Add New Owner</h1>

                    <form onSubmit={handleSubmit}>
                        <div className="mb-3">
                            <label htmlFor="firstName" className="form-label">First Name:</label>
                            <input
                                type="text"
                                id="firstName"
                                className="form-control text-hover-costem"
                                placeholder="First Name"
                                value={formData.firstName}
                                onChange={handleChange}
                            />
                        </div>

                        <div className="mb-3">
                            <label htmlFor="lastName" className="form-label">Last Name:</label>
                            <input
                                type="text"
                                id="lastName"
                                className="form-control text-hover-costem"
                                placeholder="Last Name"
                                value={formData.lastName}
                                onChange={handleChange}
                            />
                        </div>

                        <div className="mb-3">
                            <label htmlFor="address" className="form-label">Address:</label>
                            <input
                                type="text"
                                id="address"
                                className="form-control text-hover-costem"
                                placeholder="Address"
                                value={formData.address}
                                onChange={handleChange}
                            />
                        </div>

                        <div className="mb-3">
                            <label htmlFor="city" className="form-label">City:</label>
                            <input
                                type="text"
                                id="city"
                                className="form-control text-hover-costem"
                                placeholder="City"
                                value={formData.city}
                                onChange={handleChange}
                            />
                        </div>

                        <div className="mb-3">
                            <label htmlFor="telephone" className="form-label">Telephone:</label>
                            <input
                                type="text"
                                id="telephone"
                                className="form-control text-hover-costem"
                                placeholder="Telephone"
                                value={formData.telephone}
                                onChange={handleChange}
                            />
                        </div>

                        {error && (
                            <div className="alert alert-danger" role="alert">
                                {error}
                            </div>
                        )}

                        <button type="submit" className="btn-fowner" disabled={loading}>
                            {loading ? "Adding..." : "Add Owner"}
                        </button>
                    </form>
                </div>
            </div>
            <Footer />
        </>
    );
}
